import React, { useState } from 'react';
import { FiSearch, FiPhone, FiMail } from 'react-icons/fi';

const ContactsPage = () => {
  const [searchTerm, setSearchTerm] = useState('');

  const contacts = [
    { id: 1, name: 'John Doe', phone: '+1 234 567 890', email: 'john@example.com' },
    { id: 2, name: 'Jane Smith', phone: '+1 987 654 321', email: 'jane@example.com' },
    { id: 3, name: 'Alice Johnson', phone: '+1 555 123 456', email: 'alice@example.com' },
    // Add more contacts as needed
  ];

  const filteredContacts = contacts.filter(contact =>
    contact.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="max-w-2xl mx-auto">
        <div className="mb-6 relative">
          <input
            type="text"
            placeholder="Search contacts..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-full p-3 pl-10 bg-white dark:bg-gray-800 border border-gray-300 dark:border-gray-700 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-indigo-500"
          />
          <FiSearch className="absolute left-3 top-3.5 text-gray-400" />
        </div>
        <div className="space-y-4">
          {filteredContacts.map(contact => (
            <div key={contact.id} className="bg-white dark:bg-gray-800 p-4 rounded-lg shadow-md">
              <h3 className="text-lg font-semibold text-gray-800 dark:text-white mb-2">{contact.name}</h3>
              <div className="flex items-center text-gray-600 dark:text-gray-300 mb-1">
                <FiPhone className="mr-2" />
                <span>{contact.phone}</span>
              </div>
              <div className="flex items-center text-gray-600 dark:text-gray-300">
                <FiMail className="mr-2" />
                <span>{contact.email}</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ContactsPage;
